import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import HomePage from "./components/HomePage";
import SignupPage from "./components/Signup";  // Import the SignupPage component
import LoginPage from "./components/Login";   // Import the LoginPage component

const App = () => {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/" element={<HomePage />} /> {/* Render the HomePage component */}
          <Route path="/signup" element={<SignupPage />} /> {/* Render the SignupPage component */}
          <Route path="/login" element={<LoginPage />} />  {/* Render the LoginPage component */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
